from typing import List

class Solution:
    def numMatchingSubseq(self, s: str, words: List[str]) -> int:
        wordCount = len(words)
        for letter in s:
            if words == []:
                break

            i = 0
            while i < len(words) and words != []:
                if words[i][0] == letter:
                    words[i] = words[i][1:]

                    if words[i] == "":
                        words.pop(i)
                        i -= 1
                i += 1
        return wordCount - len(words)
            
